function aabbCollision(a, b) {
	const aHWidth = a.width * 0.5;
	const bHWidth = b.width * 0.5;
	const aHHeight = a.height * 0.5;
	const bHHeight = b.height * 0.5;

	return (
		a.x - aHWidth < b.x + bHWidth &&
		a.x + aHWidth > b.x - bHWidth &&
		a.y - aHHeight < b.y + bHHeight &&
		a.y + aHHeight > b.y - bHHeight
	);
}

function resolvePlayerBlockCollision(playerObj, obj1) {
	const dx = playerObj.x - obj1.x;
	const dy = playerObj.y - obj1.y;

	const obj0HalfWidth = playerObj.width * 0.5;
	const obj0HalfHeight = playerObj.height * 0.5;
	const obj1HalfWidth = obj1.width * 0.5;
	const obj1HalfHeight = obj1.height * 0.5;

	let assist = (obj0HalfHeight + obj1HalfHeight - Math.abs(dy) <= playerObj.height * 0.5);

	if (playerObj.mode === 0) {
		assist = assist && dy <= 0;
	}

	const hitboxScale = assist ? 1 : 0.3;

	const overlapX = (obj0HalfWidth * hitboxScale + obj1HalfWidth) - Math.abs(dx);
	const overlapY = (obj0HalfHeight * hitboxScale + obj1HalfHeight) - Math.abs(dy);

	if (overlapX > 0 && overlapY > 0) {
		if (overlapY < overlapX || assist) {
			if (dy < 0) {
				// alert("top");
				return {
					dir: "top",
					normal: -overlapY
				};
			} else {
				// alert("bottom");
				return {
					dir: "bottom",
					normal: overlapY
				};
			}
		} else {
			if (dx < 0) {
				// alert("left");
				return {
					dir: "left",
					normal: -overlapX
				};
			} else {
				// alert("right");
				return {
					dir: "right",
					normal: overlapX
				};
			}
		}
	}

	return false;
}

function nearGround(player, blockArr, time) {
	const sensor = {
		x: player.x,
		y: player.y + player.height * 0.5 + 1,
		width: player.width * 0.5,
		height: 2
	};

	for (let i = 0; i < blockArr.length; i++) {
		if (blockArr[i].hitbox === false) continue;
		if (aabbCollision(sensor, blockArr[i])) {
			const v = (blockArr[i].y - blockArr[i].height * 0.5) - (player.y + player.height * 0.5);
			if (Math.abs(v) > blockArr[i].height * 0.5) return false;
			return v;
		}
	}

	return false;
}

const GRID_SIZE = 32;
const HALF_GRID_SIZE = GRID_SIZE * 0.5;
const INV_GRID_SIZE = 1 / GRID_SIZE;

class Player {
	constructor(x, y, width, height) {
		this.x = x;
		this.y = y;
		this.vx = 0;
		this.vy = 0;
		this.width = width;
		this.height = height;
		this.rotation = 0;
		this.grounded = false;
		this.devColor = "#7dff00";
		this.dead = false;
		this.mode = 0;
	}

	draw(context) {
		context.save();
		context.translate(this.x, this.y);
		// context.lineWidth = 0.5;
		// context.strokeStyle = "#ffff00";
		// context.strokeRect(-this.width * 0.5, -this.height * 0.5, this.width, this.height);
		context.rotate(this.rotation);

		const halfW = this.width * 0.5;
		const halfH = this.height * 0.5;
		const fracWidth = 1.25 * this.width;
		const fracHeight = (11 / 15) * this.height;

		if (this.mode === 0) {
			context.drawImage(playerImg, -halfW, -halfH, this.width, this.height);
		} else if (this.mode === 1) {
			const offsetY = halfH - fracHeight - this.height * 0.1875;
			context.drawImage(playerImg, -this.width * 0.25, offsetY, halfW, halfH);
			context.drawImage(shipImg, -fracWidth * 0.5, halfH - fracHeight, fracWidth, fracHeight);
		}

		context.restore();

		// const hbw = this.width * 0.3 * 0.5;
		// const hbh = this.height * 0.3 * 0.5;
		// context.save();
		// context.translate(this.x, this.y);
		// context.fillStyle = "#ff0000";
		// context.fillRect(-hbw, -hbh, hbw * 2, hbh * 2);
		// context.restore();
	}
}

class Camera {
	constructor(x, y, zoom) {
		this.x = x;
		this.y = y;
		this.zoom = zoom;
	}

	applyToContext(context, width, height) {
		context.translate(width * 0.5, height * 0.5);
		context.scale(this.zoom, this.zoom);
		context.translate(-this.x, -this.y);
	}
}


