//const levelSpeed = 320; // Need to adjust this. For now, I'll leave it at 10 blocks/sec, because it mostly solves my issues.
const levelSpeed = 344;
const player = new Player(0, -16, GRID_SIZE, GRID_SIZE);
player.vx = levelSpeed;
const camera = new Camera(0, -64, 1.75);
let activePortalY = 0;

const mouse = {
	x: 0,
	y: 0,
	down: false
};

const level = {
	blocks: [],
	spikes: [],
	portals: []
};

let floorPosition = 0;

const defaultValues = {
	width: GRID_SIZE,
	height: GRID_SIZE,
	type: 1,
	rotation: 0,
	hitbox: true
};

const gravity = {
	cube: 2875,
	ship: 1024
};

const jumpForce = {
	cube: -613,
	ship: -2048
};

const modeToType = {
	0: "cube",
	1: "ship"
};

const sectionParent = {
	b: "blocks",
	s: "spikes",
	p: "portals"
};

function loadMap(str = "v1!") {
	try {
		level.blocks = [];
		level.spikes = [];

		const content = str.split("!");
		const data = content[1];
		if (!data) return;

		const sections = data.split("|");
		for (let i = 0; i < sections.length; i++) {
			const section = sections[i];
			if (!section) continue;

			const innerContent = section.split(":");
			if (!innerContent[1]) continue;

			const target = level[sectionParent[innerContent[0]]];
			if (!target) continue;
			const objects = innerContent[1].split(";");
			for (let j = 0; j < objects.length; j++) {
				if (!objects[j]) continue;
				const props = objects[j].split(",");
				target.push({
					x: parseFloat(props[0] || 0),
					y: parseFloat(props[1] || 0),
					width: (isNaN(props[2]) || props[2] === "") ? defaultValues.width : parseFloat(props[2]),
					height: (isNaN(props[3]) || props[3] === "") ? defaultValues.height : parseFloat(props[3]),
					type: (isNaN(props[4]) || props[4] === "") ? defaultValues.type : parseFloat(props[4]),
					rotation: (isNaN(props[5]) || props[5] === "") ? defaultValues.rotation : parseFloat(props[5]),
					hitbox: (isNaN(props[6]) || props[6] === "") ? defaultValues.hitbox : !!(+props[6])
				});
			}
		}
	} catch (err) {
		console.error(err);
		showDevMessage(err, 2);
	}
}


let displayTopGround = false;

let topGroundY = -GRID_SIZE * 10;
let bottomGroundY = floorPosition;

let animTopGroundY = -GRID_SIZE * 10;
let animBottomGroundY = floorPosition;

let colTriggered = false;

let levelEnd = 0;

function reset() {
	player.x = 0;
	// player.x = 24000;
	player.y = -16;
	// player.y = -164;
	player.vx = levelSpeed;
	player.vy = 0;
	player.dead = false;
	player.rotation = 0;
	player.grounded = true;
	player.mode = 0;
	camera.y = player.y - 1.5 * GRID_SIZE;
	colTriggered = false;
	displayTopGround = false;
}

function inViewFrustum(obj) {
	const invZoom = 1 / camera.zoom;
	const cameraLeft = camera.x - hVWidth * invZoom;
	const cameraRight = camera.x + hVWidth * invZoom;
	const cameraTop = camera.y - hVHeight * invZoom;
	const cameraBottom = camera.y + hVHeight * invZoom;
	return obj.x + obj.width * 0.5 > cameraLeft || obj.x - obj.width * 0.5 < cameraRight || obj.y + obj.height * 0.5 > cameraTop || obj.y - obj.height * 0.5 < cameraBottom;
}

function isPressingJumpKey() {
	return (mouse.down || keysDown["w"] || keysDown[" "] || keysDown["arrowup"]);
}

function update(time) {
	if (player.dead) return;

	if (player.x >= levelEnd) {
		player.dead = true;
		setTimeout(reset, 500);
		return;
	}

	const substeps = Math.ceil(time * 120);
	const substepTime = time / substeps;
	for (let s = 0; s < substeps; s++) {
		if (player.dead) {
			return;
		}



		if (!player.grounded) {
			if (player.mode === 0) {
				player.rotation += 2.222 * Math.PI * substepTime;
			} else if (player.mode === 1) {
				const lerpFactor = 1 - Math.exp(-16 * substepTime);
				player.rotation = lerpAngle(player.rotation, Math.atan2(player.vy * substepTime, player.vx * substepTime), lerpFactor);
			}

			player.vy += gravity[modeToType[player.mode]] * substepTime;

			if (player.mode === 1) {
				player.vy = clamp(player.vy, -484.84848, 484.84848);
			}
		} else {
			player.vy = 0;

			if (player.mode === 0) {
				const snapTarget = Math.round(player.rotation / halfPi) * halfPi;
				const lerpFactor = 1 - Math.exp(-64 * substepTime);
				player.rotation = lerpAngle(player.rotation, snapTarget, lerpFactor);
			} else if (player.mode === 1) {
				const lerpFactor = 1 - Math.exp(-16 * substepTime);
				player.rotation = lerpAngle(player.rotation, 0, lerpFactor);
			}
		}

		if (player.mode === 0) {
			if (player.grounded && isPressingJumpKey()) {
				player.grounded = false;
				player.vy += jumpForce[modeToType[player.mode]];
			}
		} else if (player.mode === 1) {
			if (isPressingJumpKey()) {
				player.grounded = false;
				player.vy += jumpForce[modeToType[player.mode]] * substepTime;
			}
		}

		player.x += player.vx * substepTime;
		player.y += player.vy * substepTime;

		let grounded = false;

		for (let i = 0; i < level.blocks.length; i++) {
			const block = level.blocks[i];
			if (block.hitbox === false || !inViewFrustum(block)) continue;

			if (aabbCollision(player, block)) {
				const collision = resolvePlayerBlockCollision(player, block);
				if (!collision) continue;

				if (collision.dir === "left" || collision.dir === "right") {
					player.dead = true;
				}

				if (collision.dir === "bottom") {
					if (player.mode === 0) {
						player.dead = true;
					} else if (player.vy <= 0) {
						player.y += collision.normal;
						player.vy = 0;
					}
				}

				if (collision.dir === "top" && player.vy >= 0) {
					player.y += collision.normal;
					player.vy = 0;
					grounded = true;
				}
			}
		}

		for (let i = 0; i < level.spikes.length; i++) {
			const spike = level.spikes[i];
			if (!inViewFrustum(spike)) continue;

			const hitbox = { x: spike.x, y: spike.y, width: spike.width * 0.1875, height: spike.height * 0.4375 };
			if (aabbCollision(player, hitbox)) {
				player.dead = true;
				break;
			}
		}

		for (let i = 0; i < level.portals.length; i++) {
			const portal = level.portals[i];
			if (!inViewFrustum(portal)) continue;

			const hitbox = { x: portal.x, y: portal.y, width: portal.width, height: portal.height };
			if (portal.rotation === 1 || portal.rotation === 3) {
				hitbox.width = portal.height;
				hitbox.height = portal.width;
			}

			if (aabbCollision(player, hitbox)) {
				if (portal.type === 1) {
					player.mode = 0;
				} else if (portal.type === 2) {
					player.mode = 1;
					player.rotation = Math.atan2(player.vy, player.vx);
				}
				activePortalY = Math.min(snapNumberToGrid(portal.y + 16, GRID_SIZE), floorPosition - 5 * GRID_SIZE);
			}
		}

		if (player.dead) {
			setTimeout(reset, 500);
			return;
		}

		if (player.y + player.height * 0.5 >= bottomGroundY) {
			player.y = bottomGroundY - player.height * 0.5;
			grounded = true;
		}

		if (player.mode === 1) {
			const tunnelHeight = GRID_SIZE * 10;
			if (player.y - player.height * 0.5 <= topGroundY) {
				player.y = topGroundY + player.height * 0.5;
				player.vy = 0;
			}
		}

		if (!grounded && player.vy >= 0) {
			const dist = nearGround(player, level.blocks, substepTime);
			if (dist !== false) {
				grounded = true;
				player.y += dist;
			}
		}

		if (grounded) {
			player.grounded = true;
		} else {
			player.grounded = false;
		}


		player.rotation = (player.rotation + tau) % tau;
	}
}

